Hi everyone, I’m @kateconservation — a journalist, blogger and conservationist. You can find my blog over at www.kateonconservation.com. 
.
I’ve been blogging for 9 years now about wildlife and the environment.
.
I started my blog as a space to share research, discussion and informed opinion on some of the top global issues effecting animals and wildlife conservation in the world today — as well as spotlighting campaigns and animal cruelty issues that so often fly under the radar of mainstream media outlets.
.
I share a some of my blog updates on @conservationblog and have recently started documenting my journey to “reuse, reduce and recycle” over at @sustainably2ndhand. 
.
I created the #WildlifeBloggerCrowd as a collaborative space to network, promote one another’s work, share ideas, seek mentors/mentees and grow together 🌱.
.
I hope that this becomes a space where we are introduced to — and get to know — other content creators in our field; creating new collaborations and sharing ideas! 💚.
.
Please join our Facebook group for further discussions, where everyone is invited to share thoughts, questions and knowledge.
.
